import React from 'react';
import Stagiaire from './Stagiaire';

const ListStagiaire = (props) => {
    return (
        <>
            <main className="container"> 
                <h1>Ordinateurs portables</h1> 
                <div className="row mb-2">
                    {props.ListStg.map((e,index)=><Stagiaire id={index.id} image={e.image} 
                        nom={e.nom} prenom={e.prenom} email={e.email}/>)}
                </div> 
            </main> 
        </>
    );
}

export default ListStagiaire;
